public class Puzzle11 {

    private static final Map<String, List<String>> graph = new HashMap<>();
    private static final Map<String, Long> memo = new HashMap<>();

    public static void main(String[] args) throws IOException {
        Path inputPath = Path.of("src/main/java/org/example/cli/puzzle11/11.input");
        List<String> lines = Files.readAllLines(inputPath);

        for (String line : lines) {
            parseLine(line);
        }

        long pathCount = countPaths("you");
        System.out.println("Total paths from you to out: " + pathCount);
    }

    private static void parseLine(String line) {
        if (line.isBlank()) return;
        String[] parts = line.split(": ");
        String source = parts[0];
        if (parts.length > 1) {
            String[] dests = parts[1].split(" ");
            graph.put(source, Arrays.asList(dests));
        } else {
            graph.put(source, Collections.emptyList());
        }
    }

    private static long countPaths(String current) {
        if ("out".equals(current)) {
            return 1;
        }
        if (memo.containsKey(current)) {
            return memo.get(current);
        }

        long count = 0;
        List<String> neighbors = graph.get(current);
        if (neighbors != null) {
            for (String neighbor : neighbors) {
                count += countPaths(neighbor);
            }
        }

        memo.put(current, count);
        return count;
    }
}

